import logo from './logo.svg';
import './App.css';
import * as utilities from './utils.js'
import React, { useState } from 'react';

function App() {

  const [searchInput, setSearchInput] = useState("");

  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          Output will be in console.
        </p>
        <label>Search by Title:</label>
        <input type="text" placeholder="Title" onChange={e => setSearchInput(e.target.value)} />
        <button onClick={() => utilities.getMoviesBySearchTerm(searchInput)}>Submit</button>
        {"\n"}
        <label>Search by ID:</label>
        <input type="text" placeholder="ID" onChange={e => setSearchInput(e.target.value)} />
        <button onClick={() => utilities.getMoviesBySearchTerm(searchInput)}>Submit</button>
      </header>
    </div>
  );
}

export default App;
